webpackJsonp([0x7e448ae76bc6],{664:function(e,a){e.exports={data:{allDataJson:{edges:[{node:{bmjsiteHead:[{id:"34866726",accountId:"5351042",webPropertyId:"UA-5351042-34",name:"bmjopen.bmj.com - Reporting",websiteUrl:"http://bmjopen.bmj.com"}],bmjsiteData:[{pagePath:"/content/8/3/e019438",pageTitle:"Effect of pasta in the context of low-glycaemic index dietary patterns on body weight and markers of adiposity: a systematic review and meta-analysis of randomised controlled trials in adults | BMJ Open",pageviews:"2153"},{pagePath:"/content/4/9/e005055",pageTitle:"The role of hospital managers in quality and patient safety: a systematic review | BMJ Open",pageviews:"1016"},{pagePath:"/content/5/11/e008052.full",pageTitle:"Bicycling injury hospitalisation rates in Canadian jurisdictions: analyses examining associations with helmet legislation and mode share | BMJ Open",pageviews:"686"},{pagePath:"/content/5/9/e007118",pageTitle:"The effect of statins on average survival in randomised trials, an analysis of end point postponement | BMJ Open",pageviews:"623"},{pagePath:"/content/6/6/e010401",pageTitle:"Lack of an association or an inverse association between low-density-lipoprotein cholesterol and mortality in the elderly: a systematic review | BMJ Open",pageviews:"502"},{pagePath:"/content/7/5/e015233",pageTitle:"Long-term antibiotics for prevention of recurrent urinary tract infection in older adults: systematic review and meta-analysis of randomised trials | BMJ Open",pageviews:"495"},{pagePath:"/content/8/3/e021312.full",pageTitle:"Trends, geographical variation and factors associated with prescribing of gluten-free foods in English primary care: a cross-sectional study | BMJ Open",pageviews:"482"},{pagePath:"/content/1/2/e000154",pageTitle:"Condom use during commercial sex among clients of Hijra sex workers in Karachi, Pakistan (cross-sectional study) | BMJ Open",pageviews:"385"},{pagePath:"/content/7/5/e013778",pageTitle:"Reducing social isolation and loneliness in older people: a systematic review protocol | BMJ Open",pageviews:"373"},{pagePath:"/content/8/4/e021076",pageTitle:"Behaviours preceding suicides at railway and underground locations: a multimethodological qualitative approach | BMJ Open",pageviews:"373"}]}}]}},pathContext:{group:[{node:{id:"93c89565-42c8-5c83-9d1d-17c22064c8ea",slug:"bmj-open-publishes-first-papers-coverage-on-bbcs-today-washington-post",title:"BMJ Open publishes first papers; coverage on BBC&#8217;s Today, Washington Post &#8230;",excerpt:'<p>BMJ Open has published its first papers. You can visit the site here. If you are looking for the paper by Bruno et al. on locked-in syndrome, as covered by BBC Radio 4&#8217;s Today programme, the BBC News website, the Washington Post, Times of India, etc., you can find it here. [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2011/02/24/bmj-open-publishes-first-papers-coverage-on-bbcs-today-washington-post/">Read More&#8230;</a></p>\n',status:"publish",date:"February 24, 2011",template:"",format:"standard"}},{node:{id:"2a48e4f1-8bb2-5d1d-814c-7cfe1893cdc1",slug:"bmj-joins-the-open-debate",title:"BMJ joins the &#8216;open&#8217; debate",excerpt:'<p>BMJ Open is the first BMJ Group journal to use fully open peer review Revealing to authors who has peer reviewed their article has helped to make the process fairer and increase the credit for reviewers, according to a recent editorial published by the BMJ. BMJ Deputy Editor, Trish Groves presents her perspectives on the [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2011/01/31/bmj-joins-the-open-debate/">Read More&#8230;</a></p>\n',status:"publish",date:"January 31, 2011",template:"",format:"standard"}},{node:{id:"90fdaaa6-2298-5c27-b9c5-abaa1a96766e",slug:"bmj-open-in-pubmed-central",title:"BMJ Open in PubMed Central",excerpt:'<p>This week BMJ Open received confirmation the journal has been accepted for inclusion in the NLM collection and so may deposit articles in PubMed Central (PMC). This means that by publishing in BMJ Open authors will meet the requirements of major funders such as the Wellcome Trust by making their articles open access and ensuring their deposition in PMC. Another reason [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2011/01/28/bmj-open-in-pubmed-central/">Read More&#8230;</a></p>\n',status:"publish",date:"January 28, 2011",template:"",format:"standard"}},{node:{id:"f0db8ccf-9337-5c05-96b5-40db40886cbe",slug:"special-launch-offer",title:"Special launch offer",excerpt:'<p>To celebrate 15 years of online and open access publishing at the BMJ Group, any articles submitted to BMJ Open before 31 January 2011 will have their article-processing charge waived at acceptance. In May 1995 the BMJ became the first general medical journal to launch itself into cyberspace &#8211; see the development of bmj.com here. [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/12/08/special-launch-offer/">Read More&#8230;</a></p>\n',status:"publish",date:"December 08, 2010",template:"",format:"standard"}},{node:{id:"c80c112a-50b5-52bc-9ba6-380b4c3a32eb",slug:"review-for-bmj-open",title:"Review for BMJ Open",excerpt:'<p>Keep your analytical skills sharp, receive public acknowledgement of your efforts and save money on publication charges! BMJ Open is now reviewing articles for publication. Peer reviewing is a good way to hone your analytical skills and to get a &#8216;first look&#8217; at forthcoming research. Our system of open peer review – publishing reviewers&#8217; comments – [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/11/02/review-for-bmj-open/">Read More&#8230;</a></p>\n',status:"publish",date:"November 02, 2010",template:"",format:"standard"}},{node:{id:"68979717-e76f-5c25-add1-e35b2d9d38ac",slug:"bmj-group-at-coasp-2010",title:"BMJ Group at COASP 2010",excerpt:'<p>The BMJ Group was represented at the 2nd Conference for Open Access Scholarly Publishers (COASP) by Dr Trish Groves of the BMJ. You can watch her presentation on open access at the BMJ Group here. [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/09/29/bmj-group-at-coasp-2010/">Read More&#8230;</a></p>\n',status:"publish",date:"September 29, 2010",template:"",format:"standard"}},{node:{id:"df301e64-0f8e-5f76-9e95-5cabe7c87cf9",slug:"have-your-research-seen-by-the-world",title:"Have your research seen by the world!",excerpt:'<p>  BMJ Open is now welcoming submissions. Submit now – and your work could be included in the launch of our brand new open access journal. Instructions for authors are available here and you can read more about BMJ Open&#8216;s aims and scope here. Open access has long been part of the BMJ Group ethos – BMJ research articles have been [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/09/20/have-your-research-seen-by-the-world/">Read More&#8230;</a></p>\n',status:"publish",date:"September 20, 2010",template:"",format:"standard"}},{node:{id:"0577cf4c-f687-5dfd-95ef-255ac38170c6",slug:"bmj-open-instructions-for-authors-posted",title:"BMJ Open instructions for authors posted",excerpt:'<p>Instructions on how to prepare a manuscript for submission to BMJ Open can be found here. Our manuscript submission site is in development; a notice will be posted on this site as soon as it is ready, so keep checking back. [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/08/31/bmj-open-instructions-for-authors-posted/">Read More&#8230;</a></p>\n',status:"publish",date:"August 31, 2010",template:"",format:"standard"}},{node:{id:"ddcdddd5-09f7-5739-95b4-fa85ffb99982",slug:"press-release",title:"Press release",excerpt:'<p>The official press release announcing BMJ Open can be found here. It includes a comment from Dr Fiona Godlee, BMJ Editor-in-Chief, that helps set BMJ Open in the context of the BMJ Group&#8217;s history of open access, and its mission to help improve patient outcomes worldwide. [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/08/23/press-release/">Read More&#8230;</a></p>\n',status:"publish",date:"August 23, 2010",template:"",format:"standard"}},{node:{id:"ada907ea-1526-5c38-a703-66b37194f664",slug:"bmj-open-faqs-posted",title:"BMJ Open FAQs posted",excerpt:'<p>A page that provides more specific information on BMJ Open has been added to the site here. Topics covered include BMJ Open&#8216;s required reporting standards for submissions, data sharing policies, article processing charges, peer review and copyright agreement. We will be adding to this document but meanwhile you can click on the Contact us link with any [&#8230;]</p>\n<p><a class="btn btn-secondary understrap-read-more-link" href="http://blogs.bmj.com/bmjopen/2010/08/20/bmj-open-faqs-posted/">Read More&#8230;</a></p>\n',status:"publish",date:"August 20, 2010",template:"",format:"standard"}}],pathPrefix:"",first:!1,last:!1,index:26,pageCount:27,additionalContext:{}}}}});
